import React from 'react';
import {
  BrowserRouter as Router,
  Route,
  Routes,
  Redirect
} from "react-router-dom";

import Parties from './parties/pages/Parties';
import MainNavigation from './shared/Navigation/MainNavigation';

import './App.css';


const App = () => {
  return (
    <React.Fragment>
      <Router>
          <MainNavigation />
          <Routes>
            <Route path="/" exact>
              <Parties /> 
            </Route>
          </Routes>
      </Router>
    </React.Fragment>
  );
}

export default App;
